// UpdateTenantID sets the "tenant_id" field to the value that was provided on create.
func (u *IndividualUpsertBulk) UpdateTenantID() *IndividualUpsertBulk {
	return u.Update(func(s *IndividualUpsert) {
		s.UpdateTenantID()
	})
}

// Exec executes the query.
func (u *IndividualUpsertBulk) Exec(ctx context.Context) error {
	if u.create.err != nil {
		return u.create.err
	}
	for i, b := range u.create.builders {
		if len(b.conflict) != 0 {
			return fmt.Errorf("ent: OnConflict was set for builder %d. Set it on the IndividualCreateBulk instead", i)
		}
	}
	if len(u.create.conflict) == 0 {
		return errors.New("ent: missing options for IndividualCreateBulk.OnConflict")
	}
	return u.create.Exec(ctx)
}

// ExecX is like Exec, but panics if an error occurs.
func (u *IndividualUpsertBulk) ExecX(ctx context.Context) {
	if err := u.create.Exec(ctx); err != nil {
		panic(err)
	}
}
